private void close() {
  try {
    if (resultSet != null)
      resultSet.close();
    if (stmt != null)
      stmt.close();

  } catch (Exception e) {
    logError("Exception while closing result set", e);
  } finally {
    resultSet = null;
    stmt = null;
  }
}

